import React from 'react';
import { useParams } from 'react-router-dom';

import { styTitle, styContainer, styContainerBtn } from './style';

const InventoryDetail = () => {
  let { id } = useParams();

  return (
    <div className={styContainer}>
      <div className={styContainerBtn}>
        <div>Back Button</div>
        <div>Edit Button</div>
      </div>
      <h1 className={styTitle}>Inventory Detail</h1> {id}
      <div>
        <div>Sku</div>
        <div>Nama Product</div>
      </div>
      <div>
        <div>
          <div>Cost Price</div>
          <div>retail Price</div>
        </div>
      </div>
    </div>
  );
};

export default InventoryDetail;
